neering drawing with the correct information to ensure that a product is manufactured correctly.</p>\\n\\n<p>This course will utilise Autodesk softwares, AutoCAD and Fusion 360.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1201f287-9d5a-4c9e-9dc9-16265aff089d\"},\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.15\",\"subContentId\":\"e4a2caaa-6741-4322-9416-642f46869354\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"Introduction\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Introduction\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<p><strong>Part drawings</strong></p>\\n\\n<p>Showing all the information that might be needed by the manufacturer of a part, including dimensions and materials.</p>\\n\\n<p><strong>Assembly drawings</strong></p>\\n\\n<p>Showing how all the individual parts gp togther, as well as a parts list. Sometimes an exploded view drawing is used.</p>\\n\\n<p> </p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"31a69223-f1f6-4c68-8b9d-9973ed3ad546\"},\"useSeparator\":\"auto\"},{\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.15\",\"subContentId\":\"53918605-3137-4bf0-a847-30d325aea028\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"Engineering drawings\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Engineering drawings\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<p><strong>Engineering sectors and CAD software types</strong></p>\\n\\n<p>Differing sectors use different software, the software can subdivided into two main workflows.</p>\\n\\n<p>2D Computer aided design is the original software designed to automate drafting on drawing boards with conventional tools such as rulers and squares. Users typically enter coordinates drawing lines and shapes and create flat drawings of objects.</p>\\n\\n<p>3D Computer aided design, this software type is much more devloped and can model items in 3 dimenions allowing users ot visualse objects. 3D software is further divided into parametric and direct modelling, the first being software that relies on shapes and constraints rather than dimensions or coordinates.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2fa35d53-6d89-4562-8c79-e38dd2133142\"},\"useSeparator\":\"auto\"},{\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.15\",\"subContentId\":\"77f5216d-dbbb-43d3-81ee-8d9b744c829d\",\"metadata\":{\"contentType\":\"Column\",\"license\":\"U\",\"title\":\"Software types\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Software types\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<p>AutoCAD</p>\\n\\n<p>AutoCAD is considered the original CAD software, developed by Autodesk and originally designed for 2D use but latter versions allow 3D use.</p>\\n\\n<p>AutoCAD is available in a number of specialist versions including Electrical, Mechanical and Architectural.</p>\\n\\n<p>The cost is shown below.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"e4645504-80af-4cbf-a545-7cfa7435f34d\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAakAAAHuCAYAAAAlcfOPAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFiUAABYlAUlSJPAAAGVPSURBVHhe7d0NXFRVwj/wn4Li9oL4hIu7uGqQidSzgJVouYApaIGixJOCuyG2IdoalJRpJA+umeyaYe4q2qNImyCFpAkJTCWyltKuga2iZrDowj9ZZ1eil4US53/OnTswDAMMiHrV39fPlZk7d+773N89554708cggIi
